import EventsList from "../components/EventsList";

const DUMMY_EVENTS = [
    {
        id:'e1',
        title: 'First Event',
    },
    {
        id:'e2',
        title: 'First Event',
    },
    {
        id:'e3',
        title: 'First Event',
    }
]

function EventsPage() {
    return <>
    <h1>Events Page</h1>
    <EventsList />
    </>
}

export default EventsPage;
